import logo from "./logo.svg";
import "./App.css";
import AppBar from "./components/AppBarX";

function App() {
  return (
    <div
      style={{
        position: "fixed",
        width: "100%",
        height: "100%",
        backgroundColor: "gray",
      }}
    >
      <AppBar />
      <div
        style={{
          right: 0,
          width: "50%",
          height: "100%",
          position: "fixed",
          backgroundColor: "red",
        }}
      ></div>
    </div>
  );
}

export default App;
